var title_f8_22_8545="Antegrade AV conduction through an accessory pathway";
var content_f8_22_8545=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75296&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75296&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 474px\">",
"   <div class=\"ttl\">",
"    Antegrade atrioventricular conduction through an accessory pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 454px; height: 300px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic representation of atrioventricular conduction in the presence of an accessory pathway with antegrade conduction. The normal pacemaker is in the sinoatrial (SA) node at the junction of the superior vena cava and the right atrium (shown in green). The SA node activates the right and left atria. Ventricular activation results from the impulse traversing the AV node, the specialized infranodal conducting system (His bundle and bundle and fascicular branches, shown in red), thereby activating the ventricular myocardium (shown in yellow). In addition, however, the presence of an accessory pathway (AP) which conducts in the antegrade direction causes early activation (preexcitation) of a portion of the left ventricle (shown in blue). The degree of preexcitation depends upon the time required to conduct through the right and left atria, the AP, and the ventricular myocardium as compared to conduction through the normal pathways. The inset of the right shows the ECG timing of these events. The net effect is a QRS complex that is a fusion of ventricular preexcitation (blue) and normal excitation (yellow). The combination of preexcitation and normal excitation leads to a short PR interval, a delta wave, and prolongation of the QRS duration. This ECG pattern is referred to as the Wolff-Parkinson-White pattern.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
