" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 568px\">",
"   <div class=\"ttl\">",
"    Surgical treatment of septic arthritis of the wrist",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 548px; height: 412px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Septic arthritis is a surgical emergency and early exploration is necessary to avoid joint damage from the disease process. The photographs show the surgical treatment of septic arthritis of the wrist. Panel A illustrates the surgical approach through the third dorsal compartment and panel B illustrates exposure of the joint and infective erosion of the carpal bones.",
