var title_f8_22_8557="Parenteral rx VRE";
var content_f8_22_8557=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F60674&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F60674&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Parenteral therapy for infections due to vancomycin resistant enterococci",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Regimen",
"      </td>",
"      <td class=\"subtitle1\">",
"       Dosage* and route",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Ampicillin-susceptible enterococci",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"2\">",
"       <strong>",
"        Monotherapy:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Ampicillin (+/- sulbactam)&bull;",
"      </td>",
"      <td>",
"       6-12 g per 24 hours in 6 equally divided doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"2\">",
"       <strong>",
"        Combination therapy:",
"       </strong>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" colspan=\"2\">",
"       <strong>",
"        Above plus one of the following:",
"       </strong>",
"       (for bactericidal activity)&Delta;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Gentamicin&loz;",
"      </td>",
"      <td>",
"       3 mg/kg per 24 hours in 3 equally divided doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent2\">",
"       Streptomycin&sect;",
"      </td>",
"      <td>",
"       15 mg/kg per 24 hours in 2 equally divided doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Ampicillin-resistant E faecium: One of the following",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       High-dose ampicillin&yen;",
"      </td>",
"      <td>",
"       18-30 g per day&Dagger;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Linezolid",
"      </td>",
"      <td>",
"       1200 mg per 24 hours in 2 equally divided doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\" rowspan=\"2\">",
"       Daptomycin&dagger;",
"      </td>",
"      <td>",
"       For E faecalis: 4 mg/kg every 24 hours (approved dose for complicated skin and soft tissue infection)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Higher dosing (8 to 12 mg/kg every 24 hours) may be more efficacious for life threatening infections due to E. faecalis or E. faecium.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Tigecycline**",
"      </td>",
"      <td>",
"       100 mg loading dose followed by maintenance dosing 50 mg every 12 hours",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Quinupristin-dalfopristin",
"      </td>",
"      <td>",
"       22.5 mg/kg per 24 hours in 3 equally divided doses",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Dosages recommended are for patients with normal renal function.",
"     <br>",
"      &bull; Infections due to beta lactamase producing enterococci may be treated with ampicillin-sulbactam.",
"      <br>",
"       &Delta; Synergistic activity of a cell wall-active agent in combination with gentamicin or streptomycin is required for bactericidal activity, which is warranted in the setting of invasive infections such as endocarditis, meningitis and bacteremia in the setting of valvulopathy and/or critical illness.",
"       <br>",
"        &loz; In patients with normal renal function, gentamicin dosing should be adjusted to achieve a 1-hour serum concentration of 3 mcg/mL and a trough concentration of &lt;1 mcg/mL.",
"        <br>",
"         &sect; In patients with normal renal function, streptomycin dosing should be adjusted to achieve a 1-hour serum concentration of 20 to 35 mcg/mL and a trough concentration of &lt;10 mcg/mL.",
"         <br>",
"          &yen; Some E faecium are ampicillin sensitive. If MIC 16-64 mcg/mL, E faecium may be treated with high-dose ampicillin.",
"          <br>",
"           &Dagger; With or without aminoglycoside (gentamicin or streptomycin).",
"           <br>",
"            &dagger; Although daptomycin has approval only for vancomycin-sensitive E. faecalis, many favor using this agent for treatment of infections due to isolates that are resistant to approved agents (including vancomycin-resistant E. faecalis and E. faecium). Appropriate dosing for soft tissue infections due to vancomycin-sensitive E. faecalis is 4 mg/kg intravenously once daily. Approved dosing for bloodstream infections due to S. aureus is 6 mg/kg intravenously once daily; some routinely use doses of 8 mg/kg intravenously once daily. Doses of up to 12 mg/kg appeared to be safe in a small number of volunteers and could be considered for life treatening VRE infections with relatively high MICs.",
"            <br>",
"             ** Although tigecycline has approval only for soft tissue and intraabdominal infections due to vancomycin-sensitive E. faecalis, some favor using this agent for treatment of non-bacteremic infections due to isolates that are resistant to approved agents (including vancomycin-resistant E. faecalis and E. faecium).",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
